<template>
  <div v-if="video">
    <h1>details</h1>
    <iframe width="1440" height="720" :src="videoUrl" frameborder="0"></iframe>
  </div>
  <div v-else>
    <!-- <img width="1440" height="720" src="data:image/jpeg;base64," alt=""> -->
  </div>
</template>

<script>
export default {
  name: 'VideoDetail',
  props: {
    video: Object,
  },
  computed: {
    videoUrl: function(){
      const videoId = this.video.id.videoId
      return `https://www.youtube.com/embed/${videoId}`
    }
  },
}
</script>

